import React, { useState } from "react";
import { Button, Card, Container, Form } from "react-bootstrap";
import Rectangle from "../img/Rectangle 5.png";
import Stack from "react-bootstrap/Stack";
import Vector from "../img/Vector.png"
import { Popup } from "../components/PopUp"
import { API } from  "../config/api"
import { useMutation, useQuery } from 'react-query'

function Cart() {
  const [modalPopShow, setModalPopShow] = useState(false);
  const detailUser = []

  const [detailUserData, setState] = useState({
    name: "",
    email: "",
    phone: "",
    posCode: "",
    address: "",
  })

  const handleOnChange = (e) => {
    setState({
      ...detailUserData,
      [e.target.name]: e.target.value,
    });
  };

  const handleOnSubmit = (e) => {
    e.preventDefault();
    detailUser.push(detailUserData);
    localStorage.setItem("DETAIL_USER", JSON.stringify(detailUser));

  };

  return (
    <Container>
      <h1
        style={{
          color: "#BD0707",
          marginLeft: "3px",
          marginTop: "20px",
          fontSize: "20px",
        }}
      >
        My Cart
      </h1>
      <p
        style={{
          color: "#BD0707",
          marginLeft: "3px",
          marginTop: "20px",
          fontSize: "20px",
        }}
      >
        Review Your Order
      </p>
      <hr style={{ width: "760px" }}></hr>
      <div>
        <Stack direction="horizontal" gap={3}>
          <img src={Rectangle} alt=""></img>
          <div>
            <Card.Title style={{ color: "#BD0707", fontSize: "15px" }}>
              Ice Coffe Palm Sugar
            </Card.Title>

            <p
              style={{ fontSize: "10px", color: "#BD0707", marginTop: "20px" }}
            >
              <strong style={{ color: "#974A4A" }}>Topping</strong> : Bill Berry
              Boba, Bubble Tea Gelatin
            </p>
          </div>
          <div
            style={{
              right: "45rem",
              position: "absolute",
              top: "15rem",
            }}
          >
            <p>Rp.33.000</p>
            <img
              src={Vector} alt=''
              style={{
                position: "absolute",
                right: "3px",
              }}
            ></img>
          </div>
        </Stack>
      </div>
      <div>
        <Stack direction="horizontal" gap={3}>
          <img src={Rectangle} alt="" style={{ marginTop: "20px" }}></img>
          <div>
            <Card.Title style={{ color: "#BD0707", fontSize: "15px" }}>
              Ice Coffe Palm Sugar
            </Card.Title>

            <p
              style={{ fontSize: "10px", color: "#BD0707", marginTop: "20px" }}
            >
              <strong style={{ color: "#974A4A" }}>Topping</strong> : Bill Berry
              Boba, Manggo
            </p>
          </div>
          <div
            style={{
              right: "720px",
              position: "absolute",
              top: "350px",
            }}
          >
            <p>Rp.36.000</p>
            <img
              src={Vector} alt=""
              style={{
                position: "absolute",
                right: "3px",
              }}
            ></img>
          </div>
        </Stack>
      </div>

      <hr style={{ width: "760px" }}></hr>

      <hr style={{ width: "330px", marginTop: "50px" }}></hr>

      <Stack direction="horizontal" gap={3}>
        <p style={{ color: "#BD0707" }}>Subtotal</p>
        <p
          style={{
            position: "absolute",
            right: "67rem",
            color: "#BD0707",
          }}
        >
          69.000
        </p>
      </Stack>

      <Stack direction="horizontal" gap={3}>
        <p style={{ color: "#BD0707" }}>Qty</p>
        <p
          style={{
            position: "absolute",
            right: "66rem",
            color: "#BD0707",
          }}
        >
          2
        </p>
      </Stack>

      <hr style={{ width: "330px", marginTop: "20px" }}></hr>

      <Stack direction="horizontal" gap={3}>
        <p style={{ color: "#BD0707", fontWeight: "bold" }}>Total</p>
        <p
          style={{
            position: "absolute",
            right: "67rem",
            color: "#BD0707",
            fontWeight: "bold",
          }}
        >
          69.000
        </p>
      </Stack>

      <div style={{ position: "absolute", right: "45rem", top: "32rem" }}>
        <Stack direction="horizontal" gap={3}>
          <img src={Kotak} alt=""></img>

          <input class="form-control" type="file" id="upload" hidden />
          <label for="upload">
            {" "}
            <img
              src={Kotakk} alt=""
              style={{ position: "absolute", left: "90px", top: "2rem" }}
            ></img>
          </label>

          <p
            style={{
              position: "absolute",
              left: "30px",
              top: "6rem",
            }}
          >
            Attach of Transaction
          </p>
        </Stack>
      </div>

      <Form onSubmit={handleOnSubmit}
        style={{
          width: "350px",
          position: "absolute",
          right: "10rem",
          top: "12rem",
        }}
      >
        <Form.Group
          className="mb-3"
          style={{ height: "50px" }}
          controlId="formBasicName"
        >
